window.bookSummaryJSON = "<p><b>This Audible Original Drama of </b><b><i>Peter Pan</i></b><b> takes listeners on a magical adventure with Peter, Wendy, Michael and John as they arrive in Neverland and take on Captain Hook with the help of Tiger Lilly and Tinker Bell. </b></p> <p>The story begins at home in London during The Blitz, and Mary Darling is planning to evacuate her children to the countryside. However, her plans take an unexpected turn when a familiar face from her childhood returns...the one and only Peter Pan, the mysterious boy from Kensington Gardens. Intrigued by their mother’s friend, Wendy, Michael and John seek Peter Pan out, resulting in them being whisked off to Neverland and setting up home with Peter, Tinker Bell and the Lost Boys.&nbsp;</p> <p>As Peter and his gang come up against the wickedly evil Captain Hook, their friendships and relationships are put to the test - can Wendy be honest with Peter about how she really feels, and will Michael and John return home without their sister?</p> <p>Rupert Everett (<i>The Happy Prince</i>, <i>My Best Friend’s Wedding</i>) stars as Captain Hook alongside Adeel Akhtar (<i>Four Lions</i>, <i>Killing Eve</i>) as Smee, Gerran Howell (<i>Catch-22</i>, <i>Emerald City</i>) as Peter Pan and Eleanor Worthington Cox (<i>Maleficent</i>, <i>Britannia</i>) as Wendy alongside a full cast.</p> <p>To mark the launch of this drama, Audible will be donating to Great Ormond Street Hospital, to whom J.M. Barrie unexpectedly and generously gifted his copyright of <i>Peter Pan</i>.</p> <p>Performed by: Adeel Akhtar, Mariska Ariya, Catherine Bailey, Rupert Everett, Neil Frost, William Harper, Gerran Howell, Simon Kane, Mack Keith Roach, Rocco Padden, Richard Reed, Maya Shepelev, Louis Suc, Harry Tuffin and Eleanor Worthington-Cox.</p>"; 
